  false,\n\t\"url\": null,\n\t\"notes\": \"Final report on a project to determine
  if refuge standard operational procedures for carcass pick-up are effective at mitigating
  avian botulism in the Sand Lake Wetland Management District and Prairie-Pothole
  wetlands.  Sand Lake WMD spends a significant amount of resources for the surveillance
  and removal of botulism carcasses.  This project hopes to determine the most appropriate
  and cost effective carcass detection and search methodologies.\",\n\t\"license_title\":
